from typing import List

class Solution:
    def findPermutation(self, s: str) -> List[int]:
        '''
            Append an "I" at the end of s. Start with res = range(1, len(s)+2)
            For every substring "DDI", reverse the res subarray that spans the indices of that substring.
            s = 'DDIDII' => 'DDIDIII'; res = [1,2,3,4,5,6,7]
            Pattern: 'DDI' spans (0,2) => [3,2,1,4,5,6,7]
            Pattern: 'DI' spans (3,4)  => [3,2,1,5,4,6,7] which is the answer.
        '''
        def reverse_subarray(arr, i, j):
            # Reverse the subarray arr[i:j+1] and return the modified array
            while i < j:
                arr[i], arr[j] = arr[j], arr[i]
                i += 1
                j -= 1
            return arr
        s += 'I'
        res = [i for i in range(1, len(s)+1)]
        in_block = False
        start, end = None, None
        for i, v in enumerate(s):
            if in_block:
                if v == 'I':
                    in_block = False
                    end = i
                    res = reverse_subarray(res, start, end)
            elif v == 'D':
                in_block = True
                start = i
        return res

# Main section
for s in [
            'I',
            'DI',
            'DDIDII',
            'DIDI',
            'III',
            'DIDDDIIDII',
            'IDIIIIIIDD',
            'IIDIIDDDIIIDDIIDDIIDIDIIIDDDIDDIIDDDIIDIIIDDDIIDIDDDIIDDDDIIIIIIDDDDDIDDIDDIIIDIDIDIIDDIIDIIIIIIDIDI',
            '',
            #'',
         ]:
    print(f's = {s}')
    sol = Solution()
    r = sol.findPermutation(s)
    print(f'r = {r}')
    print('=====================')


